import React from 'react';
import './App.css';
import HomepageImage from '\components\HomepageImage';

function App() {
  return (
    <div className="Web App">
      <header className="header">
        <h1>Smurfs</h1>
        < HomepageImage />
        <p>
          This is a test paragraph.
        </p>
      </header>
    </div>
  );
}

export default App;
